#include "includes.h"
#include "ReverbComponent.h"


ReverbComponent::ReverbComponent (TalCore* const ownerFilter)
: AudioProcessorEditor (ownerFilter)
{
    internalCachedBackgroundImage = ImageCache::getFromMemory(bmp00128_png, bmp00128_pngSize);

	// Load knob filmstrip image
	Image knobImage = ImageCache::getFromMemory(bmp00129_png, bmp00129_pngSize);

	addAndMakeVisible(roomSizeKnob = new FilmStripKnob(knobImage,
									 knobImage.getHeight() / knobImage.getWidth(),
									 false, 0));
	addAndMakeVisible(preDelayKnob = new FilmStripKnob(knobImage,
									 knobImage.getHeight() / knobImage.getWidth(),
									 false, 1));
	addAndMakeVisible(dampKnob = new FilmStripKnob(knobImage,
									 knobImage.getHeight() / knobImage.getWidth(),
									 false, 2));
	addAndMakeVisible(lowPassKnob = new FilmStripKnob(knobImage,
									 knobImage.getHeight() / knobImage.getWidth(),
									 false, 3));
	addAndMakeVisible(highPassKnob = new FilmStripKnob(knobImage,
									 knobImage.getHeight() / knobImage.getWidth(),
									 false, 4));
	addAndMakeVisible(stereoWithKnob = new FilmStripKnob(knobImage,
									 knobImage.getHeight() / knobImage.getWidth(),
									 false, 5));

    roomSizeKnob->setBounds(171, 43, knobImage.getWidth(), knobImage.getWidth());
    preDelayKnob->setBounds(271, 43, knobImage.getWidth(), knobImage.getWidth());
    dampKnob->setBounds(171, 170, knobImage.getWidth(), knobImage.getWidth());
    lowPassKnob->setBounds(271, 170, knobImage.getWidth(), knobImage.getWidth());
    highPassKnob->setBounds(370, 170, knobImage.getWidth(), knobImage.getWidth());
    stereoWithKnob->setBounds(468, 170, knobImage.getWidth(), knobImage.getWidth());

	Image sliderKnob = ImageCache::getFromMemory(bmp00130_png, bmp00130_pngSize);
	addAndMakeVisible(drySlider = new ImageSlider(sliderKnob, 152, 0));
	addAndMakeVisible(wetSlider = new ImageSlider(sliderKnob, 152, 1));

    drySlider->setBounds(585, 45, sliderKnob.getWidth(), sliderKnob.getWidth() + 113);
    wetSlider->setBounds(656, 45, sliderKnob.getWidth(), sliderKnob.getWidth() + 113);

	// Version info
	versionLabel = new Label("Version Info", "V 1.10");
	versionLabel->setBounds(4, 1, 100, 20);
	versionLabel->setColour(Label::textColourId, Colour((juce::uint8)100, (juce::uint8)100, (juce::uint8)100, 0.8f));
	addAndMakeVisible(versionLabel);


	Image offButtonImg = ImageCache::getFromMemory(bmp00132_png, bmp00132_pngSize);
	Image onButtonImg = ImageCache::getFromMemory(bmp00133_png, bmp00133_pngSize);

    // set our component's initial size to be the last one that was stored in the filter's settings
    setSize (800, 285);

	// Init values
	roomSizeKnob->setValue(ownerFilter->getParameter(ROOMSIZE), dontSendNotification);
	preDelayKnob->setValue(ownerFilter->getParameter(PREDELAY), dontSendNotification);
	dampKnob->setValue(ownerFilter->getParameter(DAMP), dontSendNotification);
	lowPassKnob->setValue(ownerFilter->getParameter(HIGHCUT), dontSendNotification);
	highPassKnob->setValue(ownerFilter->getParameter(LOWCUT), dontSendNotification);
	stereoWithKnob->setValue(ownerFilter->getParameter(STEREO), dontSendNotification);
	drySlider->setValue(ownerFilter->getParameter(DRY), dontSendNotification);
	wetSlider->setValue(ownerFilter->getParameter(WET), dontSendNotification);

	// Register change listener after initialisation
	roomSizeKnob->addListener (this);
	preDelayKnob->addListener (this);
	dampKnob->addListener (this);
	lowPassKnob->addListener (this);
	highPassKnob->addListener (this);
	stereoWithKnob->addListener (this);
	drySlider->addListener (this);
	wetSlider->addListener (this);

    // register ourselves with the filter - it will use its ChangeBroadcaster base
    // class to tell us when something has changed, and this will call our changeListenerCallback()
    // method.
    ownerFilter->addChangeListener (this);
}

ReverbComponent::~ReverbComponent()
{
    //ImageCache::release (internalCachedBackgroundImage);
    getFilter()->removeChangeListener (this);
    deleteAllChildren();
}

//==============================================================================
void ReverbComponent::paint (Graphics& g)
{
    // just clear the window
    g.fillAll (Colour::greyLevel (0.9f));

    g.drawImage (internalCachedBackgroundImage,
                 0, 0, 800, 285,
                 0, 0, internalCachedBackgroundImage.getWidth(), internalCachedBackgroundImage.getHeight());
}

//==============================================================================
void ReverbComponent::changeListenerCallback (ChangeBroadcaster* source)
{
    // this is the filter telling us that it's changed, so we'll update our
    // display of the time, midi message, etc.
    updateParametersFromFilter();
}

void ReverbComponent::sliderValueChanged (Slider* caller)
{
    TalCore* const filter = getFilter();
	if (caller == roomSizeKnob) filter->setParameterNotifyingHost(ROOMSIZE, (float)roomSizeKnob->getValue());
	if (caller == preDelayKnob) filter->setParameterNotifyingHost(PREDELAY, (float)preDelayKnob->getValue());
	if (caller == dampKnob) filter->setParameterNotifyingHost(DAMP, (float)dampKnob->getValue());
	if (caller == lowPassKnob) filter->setParameterNotifyingHost(HIGHCUT, (float)lowPassKnob->getValue());
	if (caller == highPassKnob) filter->setParameterNotifyingHost(LOWCUT, (float)highPassKnob->getValue());
	if (caller == stereoWithKnob) filter->setParameterNotifyingHost(STEREO, (float)stereoWithKnob->getValue());
	if (caller == drySlider) filter->setParameterNotifyingHost(DRY, (float)drySlider->getValue());
	if (caller == wetSlider) filter->setParameterNotifyingHost(WET, (float)wetSlider->getValue());
}

//==============================================================================
void ReverbComponent::updateParametersFromFilter()
{
    TalCore* const filter = getFilter();

    // we use this lock to make sure the processBlock() method isn't writing to the
    // lastMidiMessage variable while we're trying to read it, but be extra-careful to
    // only hold the lock for a minimum amount of time..
    filter->getCallbackLock().enter();

    // take a local copy of the info we need while we've got the lock..
	float roomSize = filter->getParameter(ROOMSIZE);
	float preDelay = filter->getParameter(PREDELAY);
	float damp = filter->getParameter(DAMP);
	float highCut = filter->getParameter(HIGHCUT);
	float lowCut = filter->getParameter(LOWCUT);
	float stereo = filter->getParameter(STEREO);

	float dry = filter->getParameter(DRY);
	float wet = filter->getParameter(WET);

    // ..release the lock ASAP
    filter->getCallbackLock().exit();

	roomSizeKnob->setValue(roomSize, dontSendNotification);
	preDelayKnob->setValue(preDelay, dontSendNotification);
	dampKnob->setValue(damp, dontSendNotification);
	lowPassKnob->setValue(highCut, dontSendNotification);
	highPassKnob->setValue(lowCut, dontSendNotification);
	stereoWithKnob->setValue(stereo, dontSendNotification);
	drySlider->setValue(dry, dontSendNotification);
	wetSlider->setValue(wet, dontSendNotification);
}

